import React, { useState } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';
import { Input } from '@/components/ui/input';
import { Button } from '@/components/ui/button';
import { Alert, AlertDescription } from '@/components/ui/alert';
import { MapPin, School, Shield, Building, Star, DollarSign, Landmark, Receipt, AlertTriangle } from 'lucide-react';

const PropertyAssessmentTool = () => {
  const [address, setAddress] = useState('');
  const [loading, setLoading] = useState(false);
  const [results, setResults] = useState(null);
  const [error, setError] = useState('');

  // Mock data generator based on address input
  const generateMockAnalysis = (address) => {
    // Generate slightly random scores but keep them reasonable
    const randScore = (base) => Math.floor(base + (Math.random() - 0.5) * 20);

    return {
      environmental: {
        floodRisk: (Math.random() * 0.3).toFixed(2),
        foundationScore: (0.7 + Math.random() * 0.3).toFixed(2),
        naturalDisasterRisk: (Math.random() * 0.3).toFixed(2),
        score: randScore(160)
      },
      education: {
        districtRating: (8 + Math.random() * 2).toFixed(1),
        numberOfSchools: Math.floor(8 + Math.random() * 8),
        averageTestScores: Math.floor(80 + Math.random() * 15),
        score: randScore(175)
      },
      crime: {
        crimeRate: 'Low',
        safetyScore: (0.8 + Math.random() * 0.2).toFixed(2),
        violentCrime: 'Very Low',
        score: randScore(170)
      },
      market: {
        competition: 'Moderate',
        marketGrowth: `${(5 + Math.random() * 5).toFixed(1)}%`,
        demandScore: (0.6 + Math.random() * 0.3).toFixed(2),
        score: randScore(155)
      },
      sentiment: {
        reputation: 'Excellent',
        socialScore: (0.7 + Math.random() * 0.3).toFixed(2),
        communityEngagement: 'High',
        score: randScore(165)
      },
      propertyDetails: {
        averagePrice: `$${(400000 + Math.random() * 200000).toFixed(0).replace(/\B(?=(\d{3})+(?!\d))/g, ",")}`,
        priceGrowth: `${(4 + Math.random() * 4).toFixed(1)}%`,
        taxRate: `${(1 + Math.random() * 0.5).toFixed(1)}%`,
        nearbyPOIs: Math.floor(15 + Math.random() * 20)
      }
    };
  };

  const calculateTotalScore = (analysis) => {
    return analysis.environmental.score + 
           analysis.education.score + 
           analysis.crime.score + 
           analysis.market.score + 
           analysis.sentiment.score;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!address.trim()) {
      setError('Please enter a valid address');
      return;
    }

    setError('');
    setLoading(true);

    // Generate mock results immediately
    setTimeout(() => {
      const mockData = generateMockAnalysis(address);
      setResults(mockData);
      setLoading(false);
    }, 800); // Short delay for loading state
  };

  const ScoreCard = ({ title, score, icon: Icon, details }) => (
    <Card className="w-full mb-4">
      <CardHeader className="flex flex-row items-center justify-between space-y-0 pb-2">
        <CardTitle className="text-sm font-medium">
          <div className="flex items-center gap-2">
            <Icon className="w-4 h-4" />
            {title}
          </div>
        </CardTitle>
        <div className="text-2xl font-bold">{score}/200</div>
      </CardHeader>
      <CardContent>
        <div className="text-xs text-muted-foreground">
          {Object.entries(details).map(([key, value]) => (
            key !== 'score' && (
              <div key={key} className="flex justify-between mt-1">
                <span>{key.replace(/([A-Z])/g, ' $1').trim()}:</span>
                <span className="font-medium">{value}</span>
              </div>
            )
          ))}
        </div>
      </CardContent>
    </Card>
  );

  const getTotalScoreColor = (score) => {
    if (score >= 800) return 'text-green-600';
    if (score >= 600) return 'text-yellow-600';
    return 'text-red-600';
  };

  return (
    <div className="max-w-4xl mx-auto p-4">
      <Card className="mb-8">
        <CardHeader>
          <CardTitle>Lennar Property Assessment Tool</CardTitle>
        </CardHeader>
        <CardContent>
          <form onSubmit={handleSubmit} className="flex gap-4">
            <Input
              type="text"
              placeholder="Enter property address (e.g., 123 Main St, City, State)"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
              className="flex-1"
            />
            <Button 
              type="submit" 
              disabled={loading}
              className="min-w-[150px]"
            >
              {loading ? 'Analyzing...' : 'Analyze Property'}
            </Button>
          </form>
          {error && (
            <Alert className="mt-4">
              <AlertDescription className="text-red-500">{error}</AlertDescription>
            </Alert>
          )}
        </CardContent>
      </Card>

      {results && (
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <ScoreCard
            title="Environmental Factors"
            score={results.environmental.score}
            icon={AlertTriangle}
            details={results.environmental}
          />
          <ScoreCard
            title="Education Rating"
            score={results.education.score}
            icon={School}
            details={results.education}
          />
          <ScoreCard
            title="Crime Statistics"
            score={results.crime.score}
            icon={Shield}
            details={results.crime}
          />
          <ScoreCard
            title="Market Competition"
            score={results.market.score}
            icon={Building}
            details={results.market}
          />
          <ScoreCard
            title="Sentiment Analysis"
            score={results.sentiment.score}
            icon={Star}
            details={results.sentiment}
          />

          <Card className="col-span-full">
            <CardHeader>
              <CardTitle>Overall Assessment</CardTitle>
            </CardHeader>
            <CardContent>
              <div className={`text-4xl font-bold mb-4 ${getTotalScoreColor(calculateTotalScore(results))}`}>
                Total Score: {calculateTotalScore(results)}/1000
              </div>

              <Alert>
                <AlertDescription>
                  Property Details:
                  <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mt-2">
                    <div className="flex items-center gap-2">
                      <DollarSign className="w-4 h-4" />
                      Average Price: {results.propertyDetails.averagePrice}
                    </div>
                    <div className="flex items-center gap-2">
                      <MapPin className="w-4 h-4" />
                      Price Growth: {results.propertyDetails.priceGrowth}
                    </div>
                    <div className="flex items-center gap-2">
                      <Receipt className="w-4 h-4" />
                      Tax Rate: {results.propertyDetails.taxRate}
                    </div>
                    <div className="flex items-center gap-2">
                      <Landmark className="w-4 h-4" />
                      Nearby POIs: {results.propertyDetails.nearbyPOIs}
                    </div>
                  </div>
                </AlertDescription>
              </Alert>
            </CardContent>
          </Card>
        </div>
      )}
    </div>
  );
};

export default PropertyAssessmentTool;
